import React from 'react'
import DepartmentSlice from '../department/DepartmentSlice'
import {useDispatch} from 'react-redux'
const Data = ({id,name,}) => {
    const dispatch=useDispatch()
    const hanldlistenchange=()=>{
        console.log(id)
        dispatch(<DepartmentSlice className="actions add"></DepartmentSlice>(id))
    }
  return (
    <div style={{display:'flex', flexDirection:'row',margin:'auto',width:'50%'}}>
      <input type="radio" name='department' onClick={hanldlistenchange} />
      <div>{name}</div>
    </div>
  )
}

export default Data
